  return (
    <div>
      <h1>React hooks & reactstrap 연습</h1>
      <h4>reactstrap으로 dropdown과 alert를 만들고, hook으로 제어해보자!</h4>
      <AlertAndDropdown />
    </div>
  );
}

export default App;
